import React from 'react'
import { useTranslation } from "react-i18next";

import { d, m, y } from "./DummyDataTable";
import TableMain from './TableMain';

const Comments = () => {
    const { t, i18n } = useTranslation();

    const columns = [
        {
            dataField: 'date',
            text: t('Date')
        },
        {
            dataField: 'comment',
            text: t('Comment')
        },
        {
            dataField: 'process',
            text: t('Process')
        },
        {
            dataField: 'activity',
            text: t('Activity')
        },
        {
            dataField: 'estatus',
            text: t('Status')
        },
        {
            dataField: 'user',
            text: t('User')
        },
    ];

    const dataTable = [
        {
            date: `${d}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
        {
            date: `${d + 1}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
        {
            date: `${d + 2}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
        {
            date: `${d + 3}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
        {
            date: `${d + 4}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
        {
            date: `${d + 5}-${m}-${y}`,
            comment: 'Comment',
            process: 'process',
            activity: 'activity',
            estatus: 'estatus',
            user: 'user',
        },
    ]

    return (
        <TableMain
            cardTitle={t("QuestionsAndAnswers")}
            dataTable={dataTable}
            columnsName={columns}
        />
    )
}

export default Comments;
